import './App.css';
import NavBar from './NavBar'
import AllRoutes from './AllRoutes';
import {BrowserRouter} from 'react-router-dom';
import plants from './plants.jpeg'

function App() {
  return (
    <BrowserRouter>
      <div className="App" style={{ 
      backgroundImage: `url(${plants})` 
    }}>
        <NavBar/>
        <AllRoutes/>
      </div>
    </BrowserRouter>
  );
}

export default App;
